import { createGlobalStyle } from "styled-components";

export const GlobalStyles = createGlobalStyle`
 *,
 *::before,
 *::after{
     margin: 0;
     padding: 0;
     box-sizing: border-box
 }   
 html {
     color: ${({ theme }) => theme.colors.white};
     background: ${({ theme }) => theme.colors.navyBlue};
 }
`;
